        el = document.getElementById("overlay");

<body th:if="${isWebRequest} == false" class="lbody">
<div class="wrapper">
    <div class="header">
        <div class="header__logo"></div>
        <div class="header__elements"></div>
    </div>
    <form method="POST" action="/landing" th:attr="action=@{order.html(sessionId=${session_id})}" name="mainFrm" class="wrapper__form"><input type="hidden" name="requestId" th:value="${requestId}"/><input type="hidden"
                                                                                                                                                                                                             name="msisdn"
                                                                                                                                                                                                             th:value="${msisdn}"/><input type="hidden"
                                                                                                                                                                                                                                          name="repeatCode"
                                                                                                                                                                                                                                          value="false"/>

        <div th:replace="fragment/errors"></div>
        <button id="wapSubmitBtn" type="submit" th:classappend="${!isWebRequest} ? 'wap'" th:if="${useSmsLink == null || useSmsLink == 'false'}" class="button__buy"><span th:switch="${evalRequestType}"><span th:case="'subscription-request'"><span
            class="button__text">ИГРАТЬ</span></span></span><span class="button__icon"></span></button>
        <span th:if="${cpaSubscriptionChargePeriodPriceCodePrice &gt; 0}"
              th:text="'Доступ: ' + ${cpaSubscriptionChargePeriodPriceCodePrice} + ' руб.' + ' за ' + ${cpaSubscriptionChargePeriodStr}"
              class="button__price">Доступ: 20 руб. за 1 день</span>
        <button class="button__cancel">Отмена</button>
    </form>
    <div class="footer"><span>Провайдер:</span>
        <td th:utext="${#strings.replace(partnerContact,',',',&amp;lt;br/&amp;gt;')}" class="content_block"></td>
        <br/><a href="http://moskva.beeline.ru/customers/products/mobile/services/details/uslugi-na-korotkikh-nomerakh/">Пользовательское соглашение</a></div>
</div>
</body>
</html>
